import React from 'react';
import './App.css';
import SimpleCard from'./loginCard.js';
import TextField from '@material-ui/core/TextField';

import Container from '@material-ui/core/Container';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';


function App() {
  return (
    <Container maxWidth="xs"> 
      <div className="App">
        <header className="App-header">
            <SimpleCard />
            <TextField
              variant = "filled"
              type = "휴대폰번호"
              label = "휴대폰번호"
              placeholder = "휴대폰번호"
              />
              <br/>
              <TextField
              variant = "filled"
              type = "비밀번호"
              label = "비밀번호"
              placeholder = "비밀번호"
              />
              ,
        </header>
      </div>
    </Container>
  );
}

export default App;
